sourcesContent:
export default function cleanSet(set, str) {
    if (typeof str !== "string" || str === "") {
        return "";
    }

    let results = [];
    set.forEach((value) => {
        if (value.startsWith(str)) {
            let cleanedValue = value.slice(str.length);
            results.push(cleanedValue);
        }
    });

    return results.join("-");
}

